import React from "react";
import './styles/training-info.css';

const TrainingInfo = () => (
  <div className="training-info">
    <p>
      種目：
      <span className="bench-press">
        <input type="text" className="exercise-input" defaultValue="ベンチプレス" readOnly />
      </span>
    </p>
    <p>対象部位：胸</p>
    <p>MAX重量：95kg</p>
    <p>消費カロリー：xxxkcal</p>
  </div>
);

export default TrainingInfo;
